export default function initializeDeck(){
	let id = 0
	const cards = ['blue','red','green','purple','silver','yellow','black','white'].reduce((acc,type) =>{
		acc.push({
			id:id++,
			type
		})
		acc.push({
			id:id++,
			type
		})
		return acc
	},[])

	return cards
}
